#
# Structure for table "cash"
#

DROP TABLE IF EXISTS `cash`;
CREATE TABLE `cash` (
  `id` bigint(50) NOT NULL AUTO_INCREMENT COMMENT '提现表主键',
  `applier_id` bigint(20) DEFAULT NULL COMMENT '申请用户Id',
  `note` varchar(255) DEFAULT NULL COMMENT '申请描述',
  `state` int(10) NOT NULL COMMENT '状态',
  `amount` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '金额',
  `auditor_id` bigint(20) DEFAULT NULL COMMENT '审核用户Id',
  `audit_time` datetime DEFAULT NULL COMMENT '审核时间',
  `remark` varchar(255) DEFAULT NULL COMMENT '审核描述',
  `version` int(11) NOT NULL DEFAULT '0',
  `created` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

#
# Data for table "cash"
#


#
# Structure for table "informant_center"
#

DROP TABLE IF EXISTS `informant_center`;
CREATE TABLE `informant_center` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `applier_id` bigint(255) DEFAULT NULL COMMENT '举报人',
  `defendant` bigint(255) DEFAULT NULL COMMENT '被举报人id',
  `content` text COMMENT '举报内容',
  `email` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '举报人email',
  `qq` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '举报人qq',
  `phone` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '举报人手机号码',
  `type` int(11) NOT NULL DEFAULT '0' COMMENT '举报类型',
  `ip` varchar(255) DEFAULT NULL COMMENT 'ip',
  `state` int(11) NOT NULL DEFAULT '0' COMMENT '举报状态 ',
  `created` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `audit_time` datetime DEFAULT NULL,
  `auditor_id` bigint(255) DEFAULT NULL COMMENT '处理人id',
  `remark` text CHARACTER SET utf8 COMMENT '处理内容',
  `version` int(11) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`),
  UNIQUE KEY `applier_id` (`applier_id`,`defendant`,`type`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='用户举报中心';

#
# Data for table "informant_center"
#


#
# Structure for table "login_info"
#

DROP TABLE IF EXISTS `login_info`;
CREATE TABLE `login_info` (
  `uid` bigint(20) NOT NULL AUTO_INCREMENT,
  `username` varchar(255) DEFAULT NULL COMMENT '用户名',
  `password` varchar(255) DEFAULT NULL COMMENT '密码',
  `phone` varchar(255) DEFAULT NULL COMMENT '手机号码',
  `state` int(11) NOT NULL DEFAULT '0' COMMENT '状态',
  `user_type` int(11) NOT NULL DEFAULT '0' COMMENT '用户类型',
  `wechat_token` varchar(255) DEFAULT NULL COMMENT '微信登录token',
  `createant_token` varchar(255) DEFAULT NULL COMMENT '创蚁token',
  `created` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `updated` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`uid`),
  UNIQUE KEY `wechat_token` (`wechat_token`),
  UNIQUE KEY `createant_token` (`createant_token`)
) ENGINE=InnoDB AUTO_INCREMENT=14418 DEFAULT CHARSET=utf8 COMMENT='用户登录信息表';

