#
# Structure for table "mch_info"
#

DROP TABLE IF EXISTS `mch_info`;
CREATE TABLE `mch_info` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `mch_name` varchar(255) DEFAULT NULL COMMENT '商户名称',
  `mch_id` varchar(255) DEFAULT NULL COMMENT '商户编号',
  `mch_key` varchar(255) DEFAULT NULL COMMENT '商户授权码',
  `state` tinyint(4) NOT NULL DEFAULT '0' COMMENT '状态  0：正常  1:停用',
  `api_permissions` varchar(255) DEFAULT NULL COMMENT '接口权限  使用数字和 | 分隔符',
  `token_source` int(4) NOT NULL DEFAULT '0' COMMENT 'token在login_info的源',
  `created` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `updated` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  UNIQUE KEY `mch_id` (`mch_id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8mb4 COMMENT='商户信息';

