#
# Structure for table "re_comment"
#

DROP TABLE IF EXISTS `re_comment`;
CREATE TABLE `re_comment` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `re_id` bigint(20) DEFAULT NULL COMMENT '红包id',
  `parent_id` bigint(20) DEFAULT NULL COMMENT '主评论id',
  `uid` bigint(20) DEFAULT NULL COMMENT '用户id',
  `reply_uid` bigint(20) DEFAULT NULL COMMENT '回复用户',
  `content` text COMMENT '内容',
  `created` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `state` int(11) NOT NULL DEFAULT '0' COMMENT '状态',
  `reply_count` int(11) NOT NULL DEFAULT '0' COMMENT '评论次数',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='红包评论';

