# Structure for table "re_item"
#

DROP TABLE IF EXISTS `re_item`;
CREATE TABLE `re_item` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `re_id` bigint(20) DEFAULT NULL COMMENT '红包id',
  `uid` bigint(20) DEFAULT NULL COMMENT '获取用户id',
  `state` int(11) NOT NULL DEFAULT '0' COMMENT '收取状态',
  `created` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `draw_time` datetime DEFAULT NULL COMMENT '领取时间',
  `amount` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '金额',
  `location` point DEFAULT NULL COMMENT '领取地址',
  `version` int(11) NOT NULL DEFAULT '0',
  `type` int(11) NOT NULL DEFAULT '0' COMMENT '类型',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=16448 DEFAULT CHARSET=utf8mb4 COMMENT='红包明细';

