#
# Structure for table "re_moment"
#

DROP TABLE IF EXISTS `re_moment`;
CREATE TABLE `re_moment` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `uid` bigint(20) NOT NULL COMMENT '用户id',
  `content` text COMMENT '内容',
  `pic_url` text COMMENT '图片',
  `state` int(11) NOT NULL DEFAULT '0' COMMENT '状态',
  `re_amount` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '红包总额',
  `re_num` int(11) NOT NULL DEFAULT '0' COMMENT '红包数量',
  `draw_amount` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '领取金额',
  `draw_count` int(11) NOT NULL DEFAULT '0' COMMENT '领取人数',
  `location` point DEFAULT NULL COMMENT '发放位置',
  `re_location` point DEFAULT NULL COMMENT '红包位置',
  `scope` int(11) NOT NULL DEFAULT '0' COMMENT '范围',
  `district_id` int(11) NOT NULL DEFAULT '0' COMMENT '县区id',
  `city_id` int(11) NOT NULL DEFAULT '0' COMMENT '城市id',
  `crowd` int(11) NOT NULL DEFAULT '0' COMMENT '面向人群',
  `link_to` varchar(255) DEFAULT NULL COMMENT '外部链接',
  `created` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `comment_count` int(11) NOT NULL DEFAULT '0' COMMENT '评论次数',
  `view_count` int(11) NOT NULL DEFAULT '0' COMMENT '浏览次数',
  `vote_count` int(11) NOT NULL DEFAULT '0' COMMENT '点赞数量',
  `type` int(11) NOT NULL DEFAULT '0' COMMENT '类型',
  `store_id` bigint(20) DEFAULT NULL COMMENT '门店ID',
  `shop_id` bigint(20) DEFAULT NULL COMMENT '店铺ID',
  `updated` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `version` int(11) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=369 DEFAULT CHARSET=utf8mb4 COMMENT='红包朋友圈';

