#

DROP TABLE IF EXISTS `re_order`;
CREATE TABLE `re_order` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `re_id` bigint(20) DEFAULT NULL COMMENT '红包id',
  `uid` bigint(20) DEFAULT NULL COMMENT '用户id',
  `order_id` varchar(255) DEFAULT NULL COMMENT '订单号',
  `state` int(11) NOT NULL DEFAULT '0' COMMENT '状态',
  `amount` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '金额',
  `pay_amount` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '支付金额',
  `pay_time` datetime DEFAULT NULL COMMENT '支付时间',
  `pay_type` varchar(255) DEFAULT NULL COMMENT '支付类型',
  `out_trade_no` varchar(255) DEFAULT NULL COMMENT '商户订单号',
  `created` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `version` int(11) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=369 DEFAULT CHARSET=utf8mb4 COMMENT='红包订单';

