#
# Structure for table "re_vote_user"
#

DROP TABLE IF EXISTS `re_vote_user`;
CREATE TABLE `re_vote_user` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `re_id` bigint(20) DEFAULT NULL COMMENT '红包id',
  `uid` bigint(20) DEFAULT NULL COMMENT '用户id',
  `state` int(4) NOT NULL DEFAULT '0' COMMENT '状态  1:点赞  0：取消点赞',
  `created` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `updated` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '操作时间  点赞、取消赞时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='红包点赞用户';

