# Structure for table "shakearound_device"
#

DROP TABLE IF EXISTS `shakearound_device`;
CREATE TABLE `shakearound_device` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `i_beacon_id` varchar(255) DEFAULT NULL COMMENT '硬件id',
  `device_id` int(255) DEFAULT NULL COMMENT '微信指定设备id',
  `status` tinyint(4) NOT NULL DEFAULT '0' COMMENT '激活状态，0：未激活，1：已激活',
  `minor` int(11) DEFAULT NULL,
  `major` int(11) DEFAULT NULL,
  `uuid` varchar(255) DEFAULT NULL,
  `uid` bigint(20) DEFAULT NULL COMMENT '拥有该设备的用户id',
  `apply_id` int(11) DEFAULT NULL COMMENT '申请批次id',
  `apply_time` datetime DEFAULT NULL,
  `store_id` bigint(20) DEFAULT NULL,
  `bind_time` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=561 DEFAULT CHARSET=utf8mb4 COMMENT='摇一摇设备信息';

