#
# Structure for table "user_account"
#

DROP TABLE IF EXISTS `user_account`;
CREATE TABLE `user_account` (
  `uid` bigint(20) NOT NULL COMMENT '用户账户表主键',
  `balance` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '可用余额',
  `freeze_balance` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '冻结金额',
  `refuse_cash` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '不可提现金额',
  `version` int(11) NOT NULL DEFAULT '0' COMMENT '版本',
  `created` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `updated` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`uid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='用户账户';

