  `freeze_amount` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '当前冻结金额',
  `deal_type` int(11) NOT NULL DEFAULT '0' COMMENT '交易类型',
  `in_or_out` tinyint(4) NOT NULL DEFAULT '0' COMMENT '收入支出',
  `object_id` bigint(20) DEFAULT NULL COMMENT '关联对象',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2268 DEFAULT CHARSET=utf8mb4 COMMENT='用户账户流水';

