# Structure for table "user_class_relation"
#

DROP TABLE IF EXISTS `user_class_relation`;
CREATE TABLE `user_class_relation` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `upper` bigint(20) DEFAULT NULL COMMENT '上级',
  `junior` bigint(20) DEFAULT NULL COMMENT '下级',
  `created` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `reap_count` int(11) NOT NULL DEFAULT '0' COMMENT '收获次数',
  `reap` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '收益金额',
  `second_reap` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '二级收益',
  PRIMARY KEY (`id`),
  UNIQUE KEY `junior` (`junior`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='用户阶级关系';

