# Structure for table "user_fans"
#

DROP TABLE IF EXISTS `user_fans`;
CREATE TABLE `user_fans` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `uid` bigint(20) DEFAULT NULL COMMENT '用户id',
  `fan` bigint(20) DEFAULT NULL COMMENT '粉丝id',
  `state` tinyint(4) NOT NULL DEFAULT '0' COMMENT '状态  1：关注  0：取消关注',
  `created` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '关注时间',
  `updated` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='用户关注列表';

