# Structure for table "user_feedback"
#

DROP TABLE IF EXISTS `user_feedback`;
CREATE TABLE `user_feedback` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `applier_id` bigint(255) DEFAULT NULL COMMENT '反馈用户id',
  `phone` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '反馈号码',
  `content` text CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci COMMENT '内容',
  `created` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `state` int(11) DEFAULT '0' COMMENT '反馈状态',
  `email` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '反馈邮箱',
  `remark` text CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci COMMENT '反馈回复内容',
  `type` int(11) DEFAULT NULL COMMENT '类型  0:通用',
  `qq` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '反馈qq',
  `ip` varchar(255) DEFAULT NULL COMMENT 'ip地址',
  `audit_time` datetime DEFAULT NULL COMMENT '操作时间',
  `auditor_id` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '处理人id',
  `version` int(11) NOT NULL DEFAULT '0' COMMENT '版本',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='用户反馈';

