# Structure for table "user_info"
#

DROP TABLE IF EXISTS `user_info`;
CREATE TABLE `user_info` (
  `uid` bigint(20) NOT NULL COMMENT '用户id',
  `nickname` varchar(255) DEFAULT NULL COMMENT '昵称',
  `head_url` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '头像地址',
  `intro` text CHARACTER SET utf8 COMMENT '个性签名',
  `sex` int(11) NOT NULL DEFAULT '-1' COMMENT '性别',
  `address` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '地址',
  `register_location` point DEFAULT NULL COMMENT '注册位置',
  `bit_state` bigint(40) NOT NULL DEFAULT '0' COMMENT '用户状态值',
  `version` int(11) NOT NULL DEFAULT '0',
  `location` point DEFAULT NULL COMMENT '最后位置',
  `updated` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `promo_code` varchar(255) DEFAULT NULL COMMENT '推广码',
  `createant_uid` bigint(20) DEFAULT NULL COMMENT '创蚁用户id',
  PRIMARY KEY (`uid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='用户信息';

