#
# Structure for table "user_statistics"
#

DROP TABLE IF EXISTS `user_statistics`;
CREATE TABLE `user_statistics` (
  `uid` bigint(20) NOT NULL,
  `re_draw_amount` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '领取红包金额',
  `re_pay_amount` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '发送红包金额',
  `device_re_pay_amount` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '发送设备红包金额',
  `re_best_amount` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '红包最佳手气',
  `re_by_draw_count` int(11) NOT NULL DEFAULT '0' COMMENT '红包被领取次数',
  `re_draw_count` int(11) NOT NULL DEFAULT '0' COMMENT '领取红包次数',
  `re_pay_count` int(11) NOT NULL DEFAULT '0' COMMENT '红包发送次数',
  `total_relation_reap` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '总推广收益',
  `first_relation_reap` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '一级推广收益',
  `first_relation_count` int(11) NOT NULL DEFAULT '0' COMMENT '一级邀请人数',
  `second_relation_count` int(11) NOT NULL DEFAULT '0' COMMENT '二级邀请人数',
  `visitor_count` int(11) NOT NULL DEFAULT '0' COMMENT '访客',
  `inform_count` int(11) NOT NULL DEFAULT '0' COMMENT '提供举报次数',
  `by_inform_count` int(11) NOT NULL DEFAULT '0' COMMENT '被举报次数',
  `feedback_count` int(11) NOT NULL DEFAULT '0' COMMENT '提供反馈次数',
  `updated` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `device_count` int(11) NOT NULL DEFAULT '0' COMMENT '设备数',
  PRIMARY KEY (`uid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='用户统计信息表';

